function simtothelock($imei, $serial, $imei2) {
    if(empty($imei2)==false)
	{
		$meid = substr($imei, 0, -1);
		$status = simlock($imei, $serial, $meid, $imei2);
	}
	else
	{
	$status = simlock($imei, $serial, $meid, "");
	if($status == "TryMeid") {
		$meid = substr($imei, 0, -1);
		$status = simlock($imei, $serial, $meid, "");	
		
	}
	}
	//echo $status;
	//$con = mysql_connect("localhost", "root", "SomeTime32@") or die(mysql_error());
	//mysql_select_db("simlock") or die(mysql_error());
	if($imei != NULL && $serial != NULL && $status != NULL && $status != "TryMeid") {
        
        if($status == "Unlocked") {
            $status = "<strong><span style='color:green;'>UNLOCKED</span></strong>";
        }
		$imsi_nm="";
        if($status == "Locked") {
			foreach(IMSI_ARRAY() as $imsi)
			{
				//echo $imsi;
				$carrier=simlock_2($imei, $serial, $meid, $imei2, $imsi);
				if($carrier=="Unlocked")
				{
					$imsi_nm=$imsi;
					break;
				}
			}
            $status = "<strong><span style='color:red;'>LOCKED</span></strong>";
        }
        $device=checkInfo($imei);
		if($device!="not found")
		{
		if(empty($imei2)==false)
		{
			echo "<strong>IMEI:</strong> $imei<br><strong>IMEI2:</strong> $imei2<br> <br><strong>SN:</strong> $serial<br> <strong>SIMLOCK:</strong> $status";
		}
			else
			{
				if($status=="Unlocked")
				{
					echo "<strong>Model:</strong> $device<br><strong>Imei Number:</strong> $imei<br><strong>Serial Number:</strong> $serial<br> <strong>SIMLOCK:</strong> $status";
				}
				else
				{
				if(empty($imsi_nm)==false)
				{
					echo "<strong>Model:</strong> $device<br><strong>Imei Number:</strong> $imei<br><strong>Serial Number:</strong> $serial<br> <strong>Carrier:</strong> ".imsiChecker($imsi_nm)." <br><strong>SIMLOCK:</strong> $status";
				}
					else
					{
						echo "<strong>Model:</strong> $device<br><strong>Imei Number:</strong> $imei<br><strong>Serial Number:</strong> $serial<br> <strong>SIMLOCK:</strong> $status";
					}
			
				}
			}
		}
		else
		{
		if(empty($imei2)==false)
		{
			if($status=="Unlocked")
				{
			echo "<strong>IMEI:</strong> $imei<br><strong>IMEI2:</strong> $imei2 <br><strong>SN:</strong> $serial<br> <strong>SIMLOCK:</strong> $status";
			}
			else
			{
				if(empty($imsi_nm)==false)
				{
					echo "<strong>IMEI:</strong> $imei<br><strong>IMEI2:</strong> $imei2<br> <strong>Serial Number:</strong> $serial<br> <strong>Carrier:</strong> ".imsiChecker($imsi_nm)." <br><strong>SIMLOCK:</strong> $status";
				}
				else
				{
					echo "<strong>IMEI:</strong> $imei<br><strong>IMEI2:</strong> $imei2<br> <strong>Serial Number:</strong> $serial <br><strong>SIMLOCK:</strong> $status";
				}
			}
		}
		else
		{
		        if($status=="Unlocked")
				{
					echo "<strong>IMEI:</strong> $imei<br><strong>Serial Number:</strong> $serial<br> <strong>SIMLOCK:</strong> $status";
				}
				else
				{
				if(empty($imsi_nm)==false)
				{
					echo "<strong>IMEI:</strong> $imei<br><strong>Serial Number:</strong> $serial<br> <strong>Carrier:</strong> ".imsiChecker($imsi_nm)." <br><strong>SIMLOCK:</strong> $status";
				}
					else
					{
						echo "<strong>IMEI:</strong> $imei<br><strong>Serial Number:</strong> $serial<br> <strong>SIMLOCK:</strong> $status";
					}
			
				}
		}
		}
	}else {
        echo $imei." this is an iPhone XS/XSMAx or Xr IMEI2 is required";
